import React from 'react'

const Goal = props => {
  return (
    <div className='goal'>
      <Container>
        <Grid>
          <Grid.Row centered>
            <Grid.Column width={6}>
              <h4>Goal Date:</h4> {props.goal.goalDate}
              <h4>Bedtime Target:</h4> {props.goal.bedtimeTarget}
              <h4>Wakeup Time Target:</h4> {props.goal.wakeupTarget}
            </Grid.Column>
          </Grid.Row>
        </Grid>
      </Container>
    </div>
  )
}

export default Goal
